//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./ToknFactory.sol";

contract ToknBuy is ToknFactory {

    uint public price = 1;
    address payable public treasury;

    uint public treasuryPercentage = 5;

    constructor(string memory _platformUri) ToknFactory(_platformUri) {
       treasury = payable(msg.sender);
    }

    function buyTokn(uint _id, uint _qty) public {
        uint allowance = usdc.allowance(msg.sender, address(this));
        require(allowance >= _qty * price, "Allowance not sufficient for the transaction");
        _safeTransferFrom(toknIdToArtist[_id], msg.sender, _id, _qty, "");
        uint amount = _qty*price;
        uint treasury_amount = amount*treasuryPercentage/uint(100);
        amount = amount - treasury_amount;
        usdc.transferFrom(msg.sender, treasury, treasury_amount);
        usdc.transferFrom(msg.sender, toknIdToArtist[_id], amount);
        toknsAvailable[_id] -= _qty;
    }

    function setTreasuryPercentage(uint _pc) public {
        require(msg.sender == treasury, "Caller not authorized");
        treasuryPercentage = _pc;
    }

    function setTreasury(address _treasury) public {
        require(msg.sender == treasury, "Caller not authorized");
        treasury = payable(_treasury);
    }

    function setPrice(uint _newPrice) public {
        price = _newPrice;
    }
}
